import { Component, ViewEncapsulation, ViewChild } from '@angular/core';
import { DocumentEditorComponent, ViewChangeEventArgs, PrintService, DocumentEditorModule } from '@syncfusion/ej2-angular-documenteditor';
import { DocumentLoader } from './document-loader';
import { TitleBar } from './title-bar';
import { StatusBar } from './status-bar';
import { SBDescriptionComponent } from '../common/dp.component';
import { SBActionDescriptionComponent } from '../common/adp.component';
import { NumericTextBoxModule } from '@syncfusion/ej2-angular-inputs';
import { TooltipModule } from '@syncfusion/ej2-angular-popups';
/**
 * Print Component
 */
@Component({
    selector: 'control-content',
    templateUrl: 'print.html',
    encapsulation: ViewEncapsulation.None,
    providers: [PrintService],
    standalone: true,
    imports: [DocumentEditorModule, TooltipModule, NumericTextBoxModule, SBActionDescriptionComponent, SBDescriptionComponent]
})
export class PrintComponent {
    @ViewChild("documenteditor_print")
    public documentEditor: DocumentEditorComponent;
    public documentLoader: DocumentLoader;
    public containerPanel: HTMLElement;
    public titleBar: TitleBar;
    public statusBar: StatusBar;
    private isComponentCreated: boolean = false;

    private ngOnInit(): void {
        this.containerPanel = document.getElementById('documenteditor_container_panel');
    }
    public initHelperModules(): void {
        this.documentLoader = new DocumentLoader(this.documentEditor);
        this.titleBar = new TitleBar(document.getElementById('documenteditor_titlebar'), this.documentEditor, false);
        this.statusBar = new StatusBar(document.getElementById('documenteditor_statusbar'), this.documentEditor);
        document.getElementById('uploadfileButton').addEventListener('change', this.onFileChange);
        document.getElementById('uploadfileButton').setAttribute('accept', '.doc,.docx,.rtf,.txt,.htm,.html');
        this.documentEditor.resize();
        this.documentEditor.documentEditorSettings.printDevicePixelRatio = 2;
        this.documentEditor.pageOutline = '#E0E0E0';
        this.documentEditor.height = "590px";
        this.onLoadDefault();
        this.applyPageCountAndDocumentTitle();
    }
    private onFileChange = (args: any): void => {
        if (args.target.files[0]) {
            let path: any = args.target.files[0];
            if (path.name.substr(path.name.lastIndexOf('.')) === '.sfdt') {
                let fileReader: FileReader = new FileReader();
                fileReader.onload = (e: any) => {
                    let contents: any = e.target.result;
                    this.documentEditor.open(contents);
                };
                fileReader.readAsText(path);
                this.documentEditor.documentName = path.name.substr(0, path.name.lastIndexOf('.'));
            } else {
                this.documentLoader.loadFile(path);
            }
        }
        event.preventDefault();
    }
    private onLoadDefault(): void {
        // tslint:disable
        let defaultDocument: Object = {"sfdt":""};
        // tslint: enable             
        let waitingPopUp: HTMLElement = document.getElementById('waiting-popup');
        let overlay: HTMLElement = document.getElementById('popup-overlay');
        overlay.style.display = 'block';
        waitingPopUp.style.display = 'block';
        this.documentLoader.loadDefault(defaultDocument);
        this.documentEditor.documentName = 'Getting Started';
        waitingPopUp.style.display = 'none';
        overlay.style.display = 'none';
    }
    public documentChange = (): void => {
        if (!this.isComponentCreated) {
            this.isComponentCreated = true;
            setTimeout(() => {
                this.initHelperModules();
            });
        }
        this.applyPageCountAndDocumentTitle();
    };
    public zoomFactorChange = (): void => {
        this.statusBar.updateZoomContent();
    };

    public viewChange = (e: ViewChangeEventArgs) => {
        this.onViewChange(e);
    };
    private updateContainerSize(): void {
        let titleBarDiv: HTMLElement = document.getElementById('documenteditor_titlebar');
        let statusBarDiv: HTMLElement = document.getElementById('documenteditor_statusbar');
        if (this.containerPanel && titleBarDiv && statusBarDiv) {
			var height = window.innerHeight - (titleBarDiv.offsetHeight
                + statusBarDiv.offsetHeight) + 'px';
            this.containerPanel.style.height = height;
			this.documentEditor.height = height;
        }
    }
    private applyPageCountAndDocumentTitle(): void {
        if (this.titleBar && this.statusBar) {
            //Sets Document name.
            this.titleBar.updateDocumentTitle();
            this.statusBar.updatePageCount();
        }
    }

    public onPixelRatioChange = (args: any): void  => {
        this.documentEditor.documentEditorSettings.printDevicePixelRatio = args.value;
    }

    private onViewChange(args: ViewChangeEventArgs): void {
        this.statusBar.updatePageNumberOnViewChange(args);
    }
}